import React from 'react'

import { Wrapper, Img } from './styles'

const Card = ({ imgSrc, imgAlt, text }) => {
  return (
    <Wrapper>
      <Img src={imgSrc} alt={imgAlt} />
      <p>{text}</p>
    </Wrapper>
  )
}

export default Card
